package ex1_ordemInversa;

public class OrdemInversa {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int [] vetor = {-5, -6, 5, 9};
		
		System.out.println("Vetor");
	
		int count = 0;
		
		while(count < (vetor.length)) {
			
			System.out.println(vetor[count] + "");
			count ++;
		
		}
	
	}

}
